      SELECT DISTINCT - MIN ( - 1 ) * + - 65 * ( COUNT ( * ) ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5665.out
    data: |
      -585
